import React from 'react';
import '../App.css';
import ProjectPreview from "../project-preview/project-preview";

export const projects = [
    {
        name: "Summer Nature Art Camp for Kids (SNACK)",
        type:"Graphic Design",
        role:"Branding & Illustration",
        imgpath: "/images/teasers/SNACK-teaser.jpg",
        linkpath: "/project-page/snack"
    },
    {
        name:"Spritz & Spuntini, aperitivo bar",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/spritz-spuntini-teaser.png",
        linkpath: "/project-page/spritz-spuntini"
    },
    {
        name:"Solon Springs Educational Foundation",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/SSEF-teaser.jpg",
        linkpath: "/project-page/ssef"
    },
    {
        name:"Mountain Bike Travel",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/MTNbiketravel-teaser.jpg",
        linkpath: "/project-page/mtn-bike-travel"
    },
    {
        name: "Our Saviour's Lutheran Church",
        type: "Graphic Design",
        role: "Branding & Identity Design",
        imgpath: "/images/teasers/oslc-teaser.jpg",
        linkpath: "/project-page/oslc"
    },
    {
        name:"Hoppy Trails: bikable brewery crawls",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/hoppytrails-teaser.jpg",
        linkpath: "/project-page/hoppy-trails"
    },
    {
        name:"Valentine Card series",
        type:"Illustration",
        role:"Illustration",
        imgpath: "/images/teasers/valentines-teaser.jpg",
        linkpath: "/project-page/valentines"
    },
    {
        name:"Indexical Vegetables Poster",
        type:"Illustration",
        role:"Illustration",
        imgpath: "/images/teasers/veggieposter-teaser.jpg",
        linkpath: "/project-page/indexical-veggies"
    },
    {
        name:"Geometric Typeface",
        type:"Graphic Design",
        role:"Typographer",
        imgpath: "/images/teasers/alphabet-teaser.jpg",
        linkpath: "/project-page/typeface-design"
    },
    {
        name:"Blueberry Summer",
        type:"Guoache & Watercolor Painting",
        role:"Painting",
        imgpath: "/images/teasers/blueberry-teaser.jpg",
        linkpath: "/project-page/blueberry-summer"
    },
    {
        name:"Fish & Chives",
        type:"Watercolor Painting",
        role:"Painting",
        imgpath: "/images/teasers/vasestilllife-teaser.jpg",
        linkpath: "/project-page/fish-chives"
    },
    {
        name:"Plant Party",
        type:"Watercolor Painting",
        role:"Painting",
        imgpath: "/images/teasers/stilllife-teaser.jpg",
        linkpath: "/project-page/plant-party"
    }
];


function Portfolio() {
    return(
        <main>
            <section className="filtering">
            </section>

            <section className="gallery">
                {projects.map(project => {
                    return (
                        <ProjectPreview
                            name={project.name}
                            type={project.type}
                            role={project.role}
                            imgpath={project.imgpath}
                            linkpath={project.linkpath}

                        />
                    )
                })}
            </section>
        </main>
    )
}



export default Portfolio;
